import React from 'react';

function Usersdisplay(props) {

    const { users } = props;
    return (
        <div>
            <h1>Liste des utilisateurs</h1>
            <ul>
                {users.map((users) => (
                    <li key={users.id}>
                        <img src={users.ppicture} alt={users.name} style="width=100px; height=100px"/>
                        <p>{users.name} {users.firstname}</p>
                        <p>{users.dob}</p>
                        <p>{users.orientation}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Usersdisplay;
